webpackJsonp([52662766577245],{646:function(e,t){e.exports={data:{allMarkdownRemark:{totalCount:3,edges:[{node:{fields:{slug:"/simpsons-quotes"},excerpt:"The latest episode of The Incomparable is fantastic;  episode 410 - I Am Not a Crackpot . It's a draft of the best Simpsons Quotes with…",timeToRead:1,frontmatter:{title:"Simpsons Quotes",tags:["The Simpsons","quotes","tv","media"],cover:"/images/the-simpsons-banner.jpg",date:"2018-06-10T08:01"}}},{node:{fields:{slug:"/gotta-catch-em-all-again"},excerpt:"After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s…",timeToRead:1,frontmatter:{title:"Gotta Catch ‘Em All (again)",tags:["entertainment","tv","pokemon","family","personal"],cover:"/images/pokemon-banner.jpg",date:"2018-05-29T21:49"}}},{node:{fields:{slug:"/viva-la-bam"},excerpt:"Viva La Bam  will always be a fantastic show.",timeToRead:1,frontmatter:{title:"Viva La Bam",tags:["entertainment","tv"],cover:"https://unsplash.it/1152/300/?random?Bam",date:"2018-05-21T22:23"}}}]},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{tag:"tv",nodes:[{node:{frontmatter:{title:"Simpsons Quotes",tags:["The Simpsons","quotes","tv","media"],cover:"/images/the-simpsons-banner.jpg",date:"2018-06-10T08:01",author:"eddie"},fields:{slug:"/simpsons-quotes"},html:'<p>The latest episode of The Incomparable is fantastic; <a href="https://www.theincomparable.com/theincomparable/410/">episode 410 - I Am Not a Crackpot</a>. It\'s a draft of the best Simpsons Quotes with <a href="https://www.theincomparable.com/person/jason-snell/">Jason Snell</a> with <a href="https://www.theincomparable.com/person/glenn-fleishman/">Glenn Fleishman</a>, <a href="https://www.theincomparable.com/person/philip-michaels/">Philip Michaels</a>, <a href="https://www.theincomparable.com/person/john-siracusa/">John Siracusa</a>, and <a href="https://www.theincomparable.com/person/monty-ashley/">Monty Ashley</a>.</p>\n<p>There are some absolutely classic Simpsons episodes, and many many fantastic quotes (mainly in the first 10 seasons). After listening to this podcast I had to try and put together some of my own favourite Simpsons quotes.</p>\n<p>I tried to do a top 10, so here are 22…</p>\n<p><img src="/images/the-simpsons-quote-1.jpg" alt="The reason we have elected officials is so we don&#x27;t have to think all the time.">\n<em>Bart\'s Comet - S06E14</em></p>\n<p><img src="/images/the-simpsons-quote-2.jpg" alt="Boy, everyone is stupid except me.">\n<em>Homer the Heretic - S04E03</em></p>\n<p><img src="/images/the-simpsons-quote-3.jpg" alt="(Loud Gulp) Ahh! Sweet liquor eases the pain.">\n<em>Bart\'s Inner Child - S05E07</em></p>\n<p><img src="/images/the-simpsons-quote-4.jpg" alt="The most rewarding part was when he gave me my money.">\n<em>The Springfield Files - S08E10</em></p>\n<p><img src="/images/the-simpsons-quote-5.jpg" alt="When she sees you&#x27;ll do anything she says, she&#x27;s bound to respect you.">\n<em>Lisa\'s Date With Density - S08E07</em></p>\n<p><img src="/images/the-simpsons-quote-6.jpg" alt="I&#x27;m a white male, age 18 to 49. Everyone listens to me, no matter how dumb my suggestions are.">\n<em>Lisa vs. Malibu Stacy - S05E14</em></p>\n<p><img src="/images/the-simpsons-quote-7.jpg" alt="But my mom says I&#x27;m cool.">\n<em>Burns\' Heir - S05E18</em></p>\n<p><img src="/images/the-simpsons-quote-8.jpg" alt="What&#x27;s the point of going out? We&#x27;re just gonna wind up back here anyway.">\n<em>Scenes From the Class Struggle in Springfield - S07E14</em></p>\n<p><img src="/images/the-simpsons-quote-9.jpg" alt="Well, it&#x27;s 1am. Better go home and spend some time with the kids.">\n<em>The Springfield Files - S08E10</em></p>\n<p><img src="/images/the-simpsons-quote-10.jpg" alt="Hello, Simpson. I&#x27;m riding the bus today because Mother hid my car keys to punish me for talking to a woman on the phone. She was right to do it.">\n<em>Treehouse of Horror IV - S05E05</em></p>\n<p><img src="/images/the-simpsons-quote-11.jpg" alt="Ah, there&#x27;s nothing more exciting than science. You get all the fun of sitting still, being quiet, writing down numbers, paying attention... Science has it all.">\n<em>Bart\'s Comet - S06E14</em></p>\n<p><img src="/images/the-simpsons-quote-12.jpg" alt="In the area under &#x22;do not write in this space&#x22;, he wrote, &#x22;Okay&#x22;.">\n<em>Lisa the Beauty Queen - S04E04</em></p>\n<p><img src="/images/the-simpsons-quote-13.jpg" alt="In this house, we obey the laws of thermodynamics!">\n<em>The PTA Disbands - S06E21</em></p>\n<p><img src="/images/the-simpsons-quote-14.jpg" alt="Y&#x27;ello? You&#x27;ll have to speak up. I&#x27;m wearing a towel.">\n<em>Bart Gets Famous - S05E12</em></p>\n<p><img src="/images/the-simpsons-quote-15.jpg" alt="If a cow ever got the chance, he&#x27;d eat you and everyone you care about.">\n<em>Lisa the Vegetarian - S07E05</em></p>\n<p><img src="/images/the-simpsons-quote-16.jpg" alt="Nothing you say can upset us. We&#x27;re the MTV generation.">\n<em>Homer\'s Triple Bypass - S04E11</em></p>\n<p><img src="/images/the-simpsons-quote-17.jpg" alt="Are You hyperventilating? No, I just like to smell my lunch.">\n<em>Lisa\'s Rival - S06E02</em></p>\n<p><img src="/images/the-simpsons-quote-18.jpg" alt="Can&#x27;t we have one meeting that doesn&#x27;t end up with us digging up a corpse?">\n<em>Lisa the Iconoclast - S07E16</em></p>\n<p><img src="/images/the-simpsons-quote-19.jpg" alt="There&#x27;s something about flying a kite at night that&#x27;s so unwholesome.">\n<em>The PTA Disbands - S06E21</em></p>\n<p><img src="/images/the-simpsons-quote-20.jpg" alt="Ralph, Jesus did not have wheels.">\n<em>Bart\'s Girlfriend - S06E07</em></p>\n<p><img src="/images/the-simpsons-quote-21.jpg" alt="Just because I don&#x27;t care doesn&#x27;t mean I don&#x27;t understand.">\n<em>Lisa\'s Substitute - S02E19</em></p>',timeToRead:1}},{node:{frontmatter:{title:"Gotta Catch ‘Em All (again)",tags:["entertainment","tv","pokemon","family","personal"],cover:"/images/pokemon-banner.jpg",date:"2018-05-29T21:49",author:"eddie"},fields:{slug:"/gotta-catch-em-all-again"},html:'<p>After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s surprising how well a children’s TV show from 1997 still holds up today. A lot of it will be nostalgia for me; but Ethan is watching it as a child for the first time over 20 years after its debut - and he loves it.</p>\n<p><img src="/images/pokemon-ethan-book.jpg" alt="Ethan with my old Pokémon book"></p>\n<p>Over the last couple of months he has become obsessed with Pokémon; our house is slowly filling with toys, books, cards, clothes, and a mass of other Pokémon merchandise. It’s really surprising how quickly he’s learnt the names of all the Pokémon, much quicker than learning the far fewer letters of the alphabet a few years previous.</p>\n<p>Its going to be great fun when he’s old enough to play the games; lets see if he can beat me in battle on Pokémon Red and Blue. But for now we’ll stick with the TV show; next up is the emotional rollercoaster of <a href="https://www.imdb.com/title/tt0190641/">Pokémon: The First Movie - Mewtwo Strikes Back</a>.</p>\n<p><img src="/images/pokemon-movie-still.jpg" alt="Pokémon: The First Movie - Mewtwo Strikes Back"></p>',timeToRead:1}},{node:{frontmatter:{title:"Viva La Bam",tags:["entertainment","tv"],cover:"https://unsplash.it/1152/300/?random?Bam",date:"2018-05-21T22:23",author:"eddie"},fields:{slug:"/viva-la-bam"},html:'<p><a href="https://en.wikipedia.org/wiki/Viva_La_Bam">Viva La Bam</a> will always be a fantastic show.</p>\n<table class="image-split">\n    <tbody><tr>\n        <td>\n            <img src="/images/viva-la-bam-1.gif" alt="Bam Margera">\n        </td>\n        <td>\n            <img src="/images/viva-la-bam-2.gif" alt="Viva La Bam">\n        </td>\n    </tr>\n</tbody></table>',timeToRead:1}}],page:1,pages:1,total:3,limit:5}}}});
